import React from 'react';
import { BrowserRouter, Route, Switch } from 'react-router-dom';
import Login from './pages/Login';
import Rotas from './routes';

export default function Routes(){
    return (
        <BrowserRouter>
            <Switch>
                <Route path="/" exact element={Login} />
            </Switch>
        </BrowserRouter>
    );
}
